import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, Dimensions, TouchableOpacity, ScrollView, Image } from 'react-native';
import DialpadPin from "../Component/CustomKeypad/DailpadPin";
import DialpadKeypad from "../Component/CustomKeypad/DialpadKeypad";
import { useNavigation } from '@react-navigation/native';
import { Ionicons, AntDesign } from '@expo/vector-icons';
import { useDispatch, useSelector } from 'react-redux';
import AsyncStorage from '@react-native-async-storage/async-storage';
import MyDialog from '../DialogBox/DialogBox';
import { fetchVisitorVerify, resetState } from '../../User/Redux/Slice/Security_Panel/HomeScreenSlice';

const { width, height } = Dimensions.get("window");
const dialPadContent = [1, 2, 3, 4, 5, 6, 7, 8, 9, "Y", 0, "X"];
const dialPadSize = width * 0.2;
const dialPadTextSize = dialPadSize * 0.38;
const pinLength = 6;
const pinContainerSize = width / 1.8;
const pinSize = pinContainerSize / pinLength;
const modalDuration = 5000;

const HomeScreen = ({ }) => {
    const navigation = useNavigation();
    const dispatch = useDispatch();
    const [code, setCode] = useState([]);
    const [modalVisible, setModalVisible] = useState(false);
    const [pinEnabled, setPinEnabled] = useState(true);
    const [selectedOption, setSelectedOption] = useState(null);
    const [societyId, setSocietyId] = useState(null);
    const successMessage = useSelector(state => state.homeScreen.successMessage);
    const error = useSelector(state => state.homeScreen.error);
    const [showDialog, setShowDialog] = useState(false);
    console.log(selectedOption)

    useEffect(() => {
        if (selectedOption !== null) {
            AsyncStorage.setItem('selectedVisitorOption', selectedOption)
                .then(() => {
                    console.log('selectedVisitorOption saved:', selectedOption);
                    return AsyncStorage.getItem('selectedVisitorOption');
                })
                .then((value) => console.log('Fetched selectedVisitorOption:', value))
                .catch((error) => console.error('Error handling selectedOption in AsyncStorage:', error));
        }
    }, [selectedOption]);

    useEffect(() => {
        const getSocietyId = async () => {
            try {
                const user = await AsyncStorage.getItem('user');
                const id = JSON.parse(user).societyId;
                if (id !== null) {
                    setSocietyId(id);
                } else {
                    console.error('No societyId found in AsyncStorage');
                }
            } catch (error) {
                console.error('Error fetching societyId from AsyncStorage:', error);
            }
        };
        getSocietyId();
    }, []);

    useEffect(() => {
        if (modalVisible) {
            const timer = setTimeout(() => {
                setModalVisible(false);
                setPinEnabled(true);
                setCode([]);
            }, modalDuration);

            return () => clearTimeout(timer);
        }
    }, [modalVisible]);

    const handleEnter = () => {
        if (code.length === pinLength && selectedOption) {
            const payload = {
                societyId,
                id: code.join(''),
                visitorType: selectedOption
            };
            dispatch(fetchVisitorVerify(payload)).then((response) => {
                if (response.meta.requestStatus === 'fulfilled') {
                    setModalVisible(true);
                    setPinEnabled(false);
                    setSelectedOption(null);
                    setShowDialog(true);
                    setTimeout(() => {
                        dispatch(resetState());
                        setShowDialog(false);
                    }, 2000);
                } else {
                    setShowDialog(true);
                    setTimeout(() => {
                        dispatch(resetState());
                        setShowDialog(false);
                    }, 2000);
                }
            }).catch((error) => {
                console.error('Error:', error);
            });
        };
    };

    const handleOptionSelect = (option) => {
        setSelectedOption(option === 'guests' ? 'Guest' : 'Service');
    };

    const renderPinAndKeypad = () => {
        return (
            <View style={styles.pinContainer}>
                <View style={{ marginTop: -50 }}>
                    <DialpadPin
                        pinLength={pinLength}
                        pinSize={pinSize}
                        code={code}
                        disabled={!pinEnabled}
                    />
                </View>
                <View style={styles.textContainer}>
                    <DialpadKeypad
                        dialPadContent={dialPadContent}
                        pinLength={pinLength}
                        setCode={setCode}
                        code={code}
                        dialPadSize={dialPadSize}
                        dialPadTextSize={dialPadTextSize}
                        disabled={!pinEnabled}
                    />
                </View>
                <TouchableOpacity style={[styles.enterButton,{marginTop:-40}]} onPress={handleEnter} disabled={!pinEnabled}>
                    <Text style={styles.enterButtonText}>Enter</Text>
                </TouchableOpacity>
            </View>
        );
    }

    return (
        <View style={styles.container}>
            <View style={styles.radioContainer}>
                {selectedOption !== null ? null : (
                    <>
                        <TouchableOpacity style={[styles.radioButton, selectedOption === 'guests' && styles.selectedRadioButton,{paddingLeft:20}]} onPress={() => handleOptionSelect('guests')}>
                            <Text style={styles.radioText}>Guests</Text>
                            <View  >
                                <Image source={require("../../../assets/Security/images/guest.png")} style={styles.image} />
                            </View>
                        </TouchableOpacity>
                        <TouchableOpacity style={[styles.radioButton, selectedOption === 'service' && styles.selectedRadioButton]} onPress={() => handleOptionSelect('service')}>
                            <Text style={styles.radioText}>Service</Text>
                            <View  >
                                <Image source={require("../../../assets/Security/images/Lucky.png")} style={styles.image} />
                            </View>
                        </TouchableOpacity>
                    </>
                )}
            </View>

            {selectedOption !== null && renderPinAndKeypad()}

            <View style={styles.scrollContainer}>
                <ScrollView horizontal={true} contentContainerStyle={styles.horizontalScroll}>
                    <TouchableOpacity style={styles.menuItem} onPress={() => navigation.navigate("Staff")}>
                        <View style={styles.menuView}>
                            <Text style={styles.menuText}>Staff</Text>
                            <Image source={require("../../../assets/Security/images/guest-list.png")} style={styles.menuImage} />
                        </View>
                    </TouchableOpacity>
                    <TouchableOpacity style={styles.menuItem} onPress={() => navigation.navigate("Add Visitor")}>
                        <View style={styles.menuView}>
                            <Text style={styles.menuText}>Add Visitors</Text>
                            <Image source={require("../../../assets/Security/images/new (1).png")} style={styles.menuImage} />
                        </View>
                    </TouchableOpacity>
                    <TouchableOpacity style={styles.menuItem} onPress={() => navigation.navigate("Residents")}>
                        <View style={styles.menuView}>
                            <Text style={styles.menuText}>Residents</Text>
                            <Image source={require("../../../assets/Security/images/male.png")} style={styles.menuImage} />
                        </View>
                    </TouchableOpacity>
                </ScrollView>
            </View>
            <MyDialog
                message={successMessage || error}
                showDialog={showDialog}
                onClose={() => setShowDialog(false)}
            />
        </View>
    );
};

export default HomeScreen;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    image: {
        width: 80,
        height: 80
    },
    radioContainer: {
        flexDirection: 'row',
        marginVertical: 20,
    },
    radioButton: {
        flexDirection: 'row',
        alignItems: 'center',
        marginHorizontal:10,
        backgroundColor: '#F3E1D5',
        paddingHorizontal:10,
        paddingVertical:10,
        borderRadius: 10,
    },
    selectedRadioButton: {
        borderBottomWidth: 2,
        borderColor: '#7d0431',
    },
    radioText: {
        fontSize: 20,
        color: '#800336',
        fontWeight: "bold"
    },
    pinContainer: {
        marginTop: -180,
        alignItems: 'center',
    },
    textContainer: {
        justifyContent: 'center',
        alignItems: 'center',
        position: 'relative',
    },
    enterButton: {
        backgroundColor: '#7d0431',
        paddingVertical: 10,
        paddingHorizontal: 20,
        borderRadius: 12,
        justifyContent: 'center',
        alignItems: 'center',
    },
    enterButtonText: {
        color: '#ffffff',
        fontSize: 18,
        fontWeight: 'bold',
        // marginBottom:50
    },
    scrollContainer: {
        width: '100%',
        position: 'absolute',
        bottom: 10,
    },
    horizontalScroll: {
        paddingVertical: 0,
    },
    menuItem: {
        marginHorizontal: 5,
    },
    menuView: {
        height: 110,
        width: 160,
        backgroundColor: '#F8E9DC',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        borderRadius: 12,
        paddingHorizontal: 10,
    },
    menuText: {
        fontSize: 16,
        fontWeight: '500',
        width: 72,
    },
    menuImage: {
        height: 65,
        width: 65,
    },
});
